import React from 'react';
import {Routes, Route } from 'react-router-dom';
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';



const top10Games = [
  { label: 'The Legend of Zelda: Ocarina of Time', year: 1998 },
  { label: "Tony Hawk's Pro Skater 2", year: 2000 },
  { label: 'Grand Theft Auto IV', year: 2008 },
  { label: 'Soul Calibur', year: 1999 },
  { label: 'Super Mario Galaxy', year: 20007 },
  { label: 'Super Mario Galaxy 2', year: 2010 },
  { label: "Red Dead Redemption 2", year: 2018 },
  { label: 'Grand Theft Auto V', year: 2014 },
  { label: 'Persona 5 Royal', year: 2022 },
  { label: 'Disco Elysium', year: 2021 },
];

const ComboBox = () => (
<Autocomplete 
  className='text'
  disablePortal
  id="combo-box-demo"
  options={top10Games}
  sx={{ width: 400 }}
  renderInput={(params) => <TextField {...params} label="Games" />}
/>
)


const gameCatalog = ["The Legend of Zelda: Ocarina of Time",
"Tony Hawk's Pro Skater 2",
"Grand Theft Auto IV",
"Soul Calibur",
"Super Mario Galaxy",
"Super Mario Galaxy 2",
"Red Dead Redemption 2",
"Grand Theft Auto V",
"Persona 5 Royal",
"Disco Elysium"
];
let gamePrint = [];

for(let i = 0; i <= gameCatalog[9].length;i++){
  gamePrint.push(<input type= "text" maxlength = "1"/>)
}
function testApp() {
  
  return (
    <>
   
      <h2>TESTING Make boxes from length of the string</h2>
      <form className = "tree">
        {gamePrint}
      </form>
    </>
  );
}




const Home = () => (
  <>
  <div className='home'>
    <h1>Guess The Game</h1>
    <ComboBox />
  </div>
  <h2>GAME</h2>
  <form classname = "tree">
    {gamePrint}
  </form> 
  
</>
);



const Catalog = () => (
    <div className='catalog'>
      <h1>Catalog</h1>
    </div>
);
const GameTest = () => (
  <div className= 'game'>
      <h1>TEST</h1>
  </div>

)

const Main = () => (
  <Routes>
    <Route end path='/' element={<Home />}></Route>
    <Route end path='/catalog' element={<Catalog />}></Route>
    <Route end path='/game' element = {<GameTest />}></Route>
  </Routes>
);

export default Main;
